 *  digits : 桁数
 *  element : 入力エレメント(select, text, checkbox, radio, textarea)
 *  isChild : 下部オブジェクト
 *  excludeBlank : 下部オブジェクトの値が何もない場合除外
 * }
 */

export const ErrorCollector = {
    init : function(){
        var result = this;
        Object.keys(result).forEach(function(key){
            console.log(key. result[key]);
        })
        console.log(result);
    },
    MTable : {
        tableName : {
            name : 'テーブル名 - 論理名',
            required : true,
            digits : 30,
            element : 'text'
        },
        tableNameJp : {
            name : 'テーブル名 - 物理名',
            required : true,
            type : 'eng',
            digits : 30,
            element : 'text'
        },
        tableComment : {
            name : 'コメント',
            digits : 80,
            element : 'text'
        },
        mTableColumn : {
            isChild : 'MTableColumn',
            excludeBlank : true
        }
    },
    MTableColumn : {
        tableColumnName: {
            name : 'コラム - 論理名',
            required : true,
            digits : 30,
            element : 'text'
